        <div className='searchBar'>
        <label>Destination</label>
        <input placeholder='search' value={input} onChange={(e)=>setInput(e.target.value)}/>
        <label>Accommodation Type</label>
        <input placeholder='search' value={input} onChange={(e)=>setInput(e.target.value)}/>
        <label>Travel Mode</label>
        <input placeholder='search' value={input} onChange={(e)=>setInput(e.target.value)}/>
        </div>
    );
    }
